import React,{useState} from 'react'
import Axios from "axios"



function DisplayFunction(props) {

    const [toggle,setToggle] = useState(false);
    const [wholeData,setWholeData] = useState([]);


    let wholeData1 = [];
    const tempFunc =(useName)=>{
        return new Promise((resolve)=>{
            let profileData = {};
            Axios.get("http://localhost:3001/profile",{params:{name:useName}}).then((response)=>{
                    profileData[useName] = [];
                    for(let i =0;i<response.data.length;i++){
                        profileData[useName].push(response.data[i]);
                    }
                    resolve(profileData)
            })
        })
    }
    const myfunct = async() => {
        await Axios.get("http://localhost:3001/search",{params: {name : props.str}}).then((response)=>{
            response.data.map(async (i)=>{
                let useName = i.name;
                let temp = await tempFunc(useName);
                console.log(temp);
                wholeData1.push(temp);
                console.log(wholeData1);
                setWholeData(wholeData1);
                setToggle(true);
                console.log(wholeData);
            })
        })
        console.log(wholeData1);
        console.log(wholeData1.length);
    }



    return (
        <div className="displayFunction">
            <hr />
            Display Function
            <button onClick={myfunct}>
                click me 
            </button>
            {toggle ? (
                    wholeData1.map((val,index)=>{
                     
                            <h1 key={index}>
                                sadkjfhgsadf
                            {wholeData[index].name}
                            </h1>
                        
                        
                    })) : (
                        <>
                        Empty
                        </>
                    )
            }

        </div>
    )
}

export default DisplayFunction
